import { StyleSheet, Text, View } from "react-native";
import React from "react";

const ConfirmOrder = () => {
  return (
    <View>
      <Text>ConfirmOrder</Text>
    </View>
  );
};

export default ConfirmOrder;

const styles = StyleSheet.create({});
